import { StyleSheet } from "react-native"

const style = StyleSheet.create({
    
  pagerStyle: {
    flex: 1,
    paddingTop: 20,
    backgroundColor: 'white',
  },
  flexContainer: {
      flexDirection: 'row',
      paddingHorizontal: 10,
  },
  map:{
    height:'100%',
    width:'100%',
    borderBottomRightRadius:12,
    borderBottomLeftRadius:12
},
})

export default style;
